// import './App.css';
import React from 'react';
import MyHeader from './MyHeader';

function App() {
  const style = {
    App : {
      backgroundColor: "black",
    },
    h2: {
      color: "red",
    },
    bold_text: {
      color: "green",
    },
  };
  return (
    <div style={style.App}>
      <MyHeader />
      <h2 style={style.h2}>안녕 리액트</h2>
      <b id="bold_text">React.js</b>
    </div>
  );
}

export default App;
